import classNames from 'classnames';
import types from 'prop-types';
import React from 'react';

// Styles

import './styles.scss';

// ----------------

export const Images = props => {
  // Modify styles

  const modify = classNames({
    ' name': props,
  });



  return <div className={`name${modify}`} />;
};

// ----------------

// Type of props

Images.propTypes = {
  prop: types.string,
};

// Default value for props

Images.defaultProps = {};
